function obj = fetch( varargin )% FETCH  Fetch tagged data%% obj = fetch( tag1, tag2, ... )%% See also STORE.% 08-Jun-99 -- created (RFM)global STOREMEMobj=[];if isempty(STOREMEM)	returnendfor i=1:STOREMEM.n,		if size(varargin,2)==size(STOREMEM.list{i}.id,2),		eq=1;		for j=1:size(varargin,2),			if varargin{j}~=STOREMEM.list{i}.id{j},				eq=0;				break			end		end		if eq==1,			obj=STOREMEM.list{i}.obj;			break		end	end		if ~isempty(obj),		break	end	endreturn